import React from 'react';
import Graph from './components/Graph';
import './App.css';
import Nav from './components/Nav';
import {BrowserRouter as Router, Switch, Route } from 'react-router-dom';

function App() {
  return (
    <Router>
    <div className="App"> 
    <Nav />
      <Switch>
        <Route path='/Graph' component='./component/Graph.s'  />
      </Switch>


    </div>
    </Router>
  );
}

export default App;
